description:
The EPA’s recent air quality data is a RSS feed of hourly updated pollutant concentrations. The following averaging periods are used: hourly averages for particles (PM10) (μg/m3), fine particles (PM2.5) (μg/m3), nitrogen dioxide (ppm), ozone (ppm), and sulfur dioxide (ppm); 4-hour rolling averages for ozone (ppm); 8-hour rolling averages for carbon monoxide (ppm); and 24-hour averages for particles (PM10) (μg/m3) and fine particles (PM2.5) (μg/m3). 
Additional information available on the EPA website; 
https://www.epa.sa.gov.au/environmental_info/air_quality/new-air-quality-monitoring
